			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "set -e\n\n# If we're already inside this script then die\nif [ -n \"$ASM_MULTIPLATFORM_BUILD_IN_PROGRESS\" ]; then\nexit 0\nfi\nexport ASM_MULTIPLATFORM_BUILD_IN_PROGRESS=1\n\nASM_FRAMEWORK_NAME=${PROJECT_NAME}\nASM_INPUT_STATIC_LIB=\"lib${PROJECT_NAME}.a\"\nASM_FRAMEWORK_LOCATION=\"${BUILT_PRODUCTS_DIR}/${ASM_FRAMEWORK_NAME}.framework\"\n\nfunction build_static_library {\n    # Will rebuild the static library as specified\n    #     build_static_library sdk\n    xcrun xcodebuild -project \"${PROJECT_FILE_PATH}\" \\\n    -target \"${TARGET_NAME}\" \\\n    -configuration \"${CONFIGURATION}\" \\\n    -sdk \"${1}\" \\\n    ONLY_ACTIVE_ARCH=NO \\\n    BUILD_DIR=\"${BUILD_DIR}\" \\\n    OBJROOT=\"${OBJROOT}\" \\\n    BUILD_ROOT=\"${BUILD_ROOT}\" \\\n    SYMROOT=\"${SYMROOT}\" $ACTION\n}\n\nfunction make_fat_library {\n    # Will smash 2 static libs together\n    #     make_fat_library in1 in2 out\n    xcrun lipo -create \"${1}\" \"${2}\" -output \"${3}\"\n}\n\n# Extract the platform (iphoneos/iphonesimulator) from the SDK name\nif [[ \"$SDK_NAME\" =~ ([A-Za-z]+) ]]; then\nASM_SDK_PLATFORM=${BASH_REMATCH[1]}\nelse\necho \"Could not find platform name from SDK_NAME: $SDK_NAME\"\nexit 1\nfi\n\n# Extract the version from the SDK\nif [[ \"$SDK_NAME\" =~ ([0-9]+.*$) ]]; then\nASM_SDK_VERSION=${BASH_REMATCH[1]}\nelse\necho \"Could not find sdk version from SDK_NAME: $SDK_NAME\"\nexit 1\nfi\n\n# Determine the other platform\nif [ \"$ASM_SDK_PLATFORM\" == \"iphoneos\" ]; then\nASM_OTHER_PLATFORM=iphonesimulator\nelse\nASM_OTHER_PLATFORM=iphoneos\nfi\n\n# Find the build directory\nif [[ \"$BUILT_PRODUCTS_DIR\" =~ (.*)$ASM_SDK_PLATFORM$ ]]; then\nASM_OTHER_BUILT_PRODUCTS_DIR=\"${BASH_REMATCH[1]}${ASM_OTHER_PLATFORM}\"\nelse\necho \"Could not find other platform build directory.\"\nexit 1\nfi\n\n\n# Build the other platform.\nbuild_static_library \"${ASM_OTHER_PLATFORM}${ASM_SDK_VERSION}\"\n\n# If we're currently building for iphonesimulator, then need to rebuild\n#   to ensure that we get both i386 and x86_64\nif [ \"$ASM_SDK_PLATFORM\" == \"iphonesimulator\" ]; then\nbuild_static_library \"${SDK_NAME}\"\nfi\n\n# Join the 2 static libs into 1 and push into the .framework\nmake_fat_library \"${BUILT_PRODUCTS_DIR}/${ASM_INPUT_STATIC_LIB}\" \\\n\"${ASM_OTHER_BUILT_PRODUCTS_DIR}/${ASM_INPUT_STATIC_LIB}\" \\\n\"${ASM_FRAMEWORK_LOCATION}/Versions/A/${ASM_FRAMEWORK_NAME}\"\n\n\n# Ensure that the framework is present in both platorm's build directories\ncp -a \"${ASM_FRAMEWORK_LOCATION}/Versions/A/${ASM_FRAMEWORK_NAME}\" \\\n\"${ASM_OTHER_BUILT_PRODUCTS_DIR}/${ASM_FRAMEWORK_NAME}.framework/Versions/A/${ASM_FRAMEWORK_NAME}\"\n\n# Copy the framework to the user's desktop\nditto \"${ASM_FRAMEWORK_LOCATION}\" \"${HOME}/LI/${ASM_FRAMEWORK_NAME}.framework\"\n\n";
		};
