s\"\n/bin/cp -a \"${SRCROOT}/Resources/\" \"${FRAMEWORK_LOCN}/Versions/A/Resources\"\n\n\nelse\n# if there is no resource folder then we need to disbale FRAMEWORK_HAS_BUNDLE flag.\nif [ \"$FRAMEWORK_HAS_BUNDLE\" = true ];\nthen\necho -e \"There is no \\\"Resource\\\" folder in project root folder to copy ${BUNDLE_NAME}.bundle. If you don't want to copy bundle then turn off FRAMEWORK_HAS_BUNDLE in shell script.\"\nexit 1\nfi\nfi";
